@Component({
  selector: 'app-extrato',
  templateUrl: './extrato.component.html',
  styleUrls: ['./extrato.component.scss']
})
export class ExtratoComponent {

  transferencia: any;
}
<p>Valor: {{transferencia?.valor}}</p>
<p>Destino: {{transferencia?.destino}}</p>
